import Document, { Html, Head, Main, NextScript } from 'next/document'
// Import styled components ServerStyleSheet
import { ServerStyleSheet } from 'styled-components'
import GlobalStyles from '../styles/GlobalStyles'

export default class MyDocument extends Document {
	constructor(props) {
		super(props)
		this._ref = React.createRef()
	}

	static getInitialProps({ renderPage }) {
		// Step 1: Create an instance of ServerStyleSheet
		const sheet = new ServerStyleSheet()

		// Step 2: Retrieve styles from components in the page
		const page = renderPage((App) => (props) =>
			sheet.collectStyles(<App {...props} />)
		)

		// Step 3: Extract the styles as <style> tags
		const styleTags = sheet.getStyleElement()

		// Step 4: Pass styleTags as a prop
		return { ...page, styleTags }
	}

	render() {
		return (
			<Html>
				<Head>
					<title>Market Data Company</title>
					<meta
						name="viewport"
						content="width=device-width, initial-scale=1.0"
					/>
					<link
						rel="icon"
						type="image/png"
						href="/static/images/mdc_favicon.png"
					/>
					<link
						rel="stylesheet"
						href="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0-alpha.6/css/bootstrap.min.css"
					/>
					{this.props.styleTags}
				</Head>
				<body>
					<div class="tradingview-widget-container">
						<div class="tradingview-widget-container__widget"></div>
						<div class="tradingview-widget-copyright"><a href="https://www.tradingview.com" rel="noreferrer" target="_blank"><span class="blue-text">Ticker Tape</span></a> by TradingView</div>
						<script type="text/javascript" src="https://s3.tradingview.com/external-embedding/embed-widget-ticker-tape.js" async>
							{JSON.stringify({
								"symbols": [
									{
										"proName": "FOREXCOM:SPXUSD",
										"title": "S&P 500"
									},
									{
										"proName": "FOREXCOM:NSXUSD",
										"title": "Nasdaq 100"
									},
									{
										"proName": "FX_IDC:EURUSD",
										"title": "EUR/USD"
									},
									{
										"proName": "BITSTAMP:BTCUSD",
										"title": "BTC/USD"
									},
									{
										"proName": "BITSTAMP:ETHUSD",
										"title": "ETH/USD"
									}
								],
								"showSymbolLogo": true,
								"colorTheme": "dark",
								"isTransparent": false,
								"displayMode": "regular",
								"locale": "en"
							})}
						</script>
					</div>
					<GlobalStyles />
					<Main />
					<NextScript />
				</body>
			</Html>
		)
	}
}
